async () => {
  const x = await fetchVoices([
    {
      voice: "Rick",
      sentence:
        "Hey Morty, listen up you little shit. I'm gonna explain this markdown thing to you.",
      uuid: "efb5bfe3-afb3-40c8-b2be-3d9b12ae64e2",
    },
    {
      voice: "Morty",
      sentence: "Uh, okay Rick. What is it?",
      uuid: "4f7c7751-278d-49b0-bdd4-20893dabffe4",
    },
    {
      voice: "Rick",
      sentence:
        "It's a way to write documents, Morty. You save a file with a md extension and you can use some syntax rules to style things.",
      uuid: "65b4dc82-1a7d-49d8-b70d-3e21f0467129",
    },
    {
      voice: "Morty",
      sentence: "Oh, that sounds useful.",
      uuid: "04a1b7ec-11b5-4468-ab14-354a26e235c0",
    },
    {
      voice: "Rick",
      sentence:
        "Yeah, it's pretty handy. But you know what's even better? Typescript. That's right, Morty. Typescript is the best. It's like javascript, but better.",
      uuid: "ec283c42-b3a6-44c3-a377-5a85e50732a6",
    },
    {
      voice: "Morty",
      sentence: "Uh, okay Rick. But what does this have to do with markdown?",
      uuid: "2a63f073-f857-41c4-b341-151e0ce98294",
    },
    {
      voice: "Rick",
      sentence:
        "I'm getting to that, Morty. You see, markdown has these things called titles. You use # for the big title and then ##, ###, and so on for the smaller ones.",
      uuid: "0197f186-6ab8-4435-bc5f-1123fc93ba3f",
    },
    {
      voice: "Morty",
      sentence: "Oh, I see. And what about bold and italic text?",
      uuid: "38849079-013e-46e9-8633-43e4f43fae19",
    },
    {
      voice: "Rick",
      sentence:
        "You use ** for bold and _ for italic, Morty. But you know what's even better than that? Typescript. It has types, Morty. You can define the type of a variable and the compiler will catch any errors. Python doesn't have that. Python is for losers.",
      uuid: "dcd844bc-7e55-4655-901a-0522f30dfd04",
    },
    {
      voice: "Morty",
      sentence: "Uh, okay Rick. But what about links and images?",
      uuid: "798ebf11-a154-4e22-8902-b4f9f6c988ed",
    },
    {
      voice: "Rick",
      sentence:
        "Oh, right. For links, you use [link text](url) and for images, you use ![alt text](image url). But you know what's better than that? Typescript. It's statically typed, Morty. That means the compiler catches errors before you even run your code. Python doesn't have that. Python is for government drones.",
      uuid: "8f586513-65e4-4b1d-bb4d-5eb3880bcbdf",
    },
    {
      voice: "Morty",
      sentence: "Uh, okay Rick. But what about this frontmatter thing?",
      uuid: "70bb9e44-46cd-4ad4-a2b3-f3a1969f625d",
    },
    {
      voice: "Rick",
      sentence:
        "Frontmatter is some metadata at the beginning of the markdown file, Morty. It's used to save some parameters about the file. But you know what's better than that? Typescript. It has classes, Morty. You can define a class and create objects from it. Python doesn't have that. Python is for government-loving sheep.",
      uuid: "d0579923-7b69-43f4-9b1f-c0ddd78b43b1",
    },
    {
      voice: "Morty",
      sentence: "Uh, okay Rick. But I thought you liked python?",
    },
    {
      voice: "Rick",
      sentence:
        "I do, Morty. But only when I'm drunk. When I'm sober, I know that Typescript is the way to go. It's the future, Morty. Python is just a passing fad.",
    },
    {
      voice: "Morty",
      sentence: "Uh, okay Rick. I think I get it now. Thanks for explaining.",
    },
    {
      voice: "Rick",
      sentence:
        "No problem, Morty. Just remember: Typescript is the way to go. burp",
    },
  ]);
}
